import { Component} from "react";
class Square extends Component{
  constructor(props) {
    super(props);
  }
  render(){
    let { row, col} = this.props
    return (
      <button
        className="square_item"
        onClick={ ()=>{this.props.handleSquare(row,col)} }
      >
        {this.props.value}
      </button>
    )
  }
}
export default Square
